// validates the form, returns true when all fields valid
function validateForm() {
	result = true;
	// check search was already sent
	if ($("#send_button").hasClass("disabled")) {
		
	result = false;
	
	} else {
		// first check hidden inputs
		for (i=0;i<$("#form .seeshyinput").size();i++) {
			if ($("#form .seeshyinput").eq(i).attr("value") == "0") {
				id = "#"+$("#form .seeshyinput").eq(i).parent().parent().attr("id");
				display_error(id);
				$.scrollTo(id, 1500);
				$("#form .seeshyinput").eq(i).parent().fadeOut('medium').fadeIn('medium').fadeOut('medium').fadeIn('medium').fadeOut('medium').fadeIn('medium').fadeOut('medium').fadeIn('medium').fadeOut('medium').fadeIn('medium');
				result = false;
				break;
			} 
		}
		// check text area has at least 10 chars
		if (($("#form textarea").attr("value").length < 10) && result === true) {
			id = "#"+$("#form textarea").parent().parent().parent().attr("id");
			display_error(id);		
			$.scrollTo(id, 1500);			
			$("#form textarea").fadeOut('medium').fadeIn('medium').fadeOut('medium').fadeIn('medium');	
			result = false;
		
		// check email
		} else if (!checkEmail($("#form #email_input").attr("value")) && result === true) {
			id = "#"+$("#form #email_input").parent().parent().parent().attr("id");
			display_error(id);
			$.scrollTo(id, 1500);
			$("#form #email_input").fadeOut('medium').fadeIn('medium').fadeOut('medium').fadeIn('medium').fadeOut('medium').fadeIn('medium');		
			result = false;				
		}
	}	 

	return result;
	
}


function writeNick() {
	var nick = $('#nick_text').attr('value');
	$('#link_result_place').html(nick);
	$('#href_result_place').attr('href', replaceStr($('#href_result_place').attr('href'), nick));
	$('#twitter').attr('href', replaceStr($('#twitter').attr('href'), nick)); 
	$('#facebook').attr('href', replaceStr($('#facebook').attr('href'), nick)); 
	$('#stumbleupon').attr('href', replaceStr($('#stumbleupon').attr('href'), nick)); 
	$('#reddit').attr('href', replaceStr($('#reddit').attr('href'), nick)); 
	$('#digg').attr('href', replaceStr($('#digg').attr('href'), nick)); 	
	$('#meneame').attr('href', replaceStr($('#meneame').attr('href'), nick)); 
}

function replaceStr(str, nick) {
	return str.replace('#NICK#', escape(nick));
}


function validatePlace() {
	result = true;
	// check search was already sent
	if ($("#send_button").hasClass("disabled")) {
		
	result = false;
	
	} else {
		// first check shortname
		if (!checkNick($('#nick_text').attr('value'))) {
			result = false;
			display_error('#bad_nick');
			$('#nick_text').fadeOut('medium').fadeIn('medium').fadeOut('medium').fadeIn('medium').fadeOut('medium').fadeIn('medium');
		} else if(!checkDesc($('#desc_text').attr('value'))) {
			result = false;
			display_error('#bad_desc');
			$('#desc_text').fadeOut('medium').fadeIn('medium').fadeOut('medium').fadeIn('medium').fadeOut('medium').fadeIn('medium');
		}
	}
	
	return result;
}

// regex validation
function checkNick(input){	
    var pattern=/^([a-zA-Z0-9_-]){4,39}$/;
    if(pattern.test(input)){         
		return true;   
    }else{   
		return false; 
    }
}

// regex validation
function checkDesc(input){	
if (input.length >= 4 && input.length < 70) {
	return true;
}
else { return false;}
}

// regex validation
function checkEmail(inputvalue){	
    var pattern=/^([a-zA-Z0-9_.-])+@([a-zA-Z0-9_.-])+\.([a-zA-Z])+([a-zA-Z])+/;
    if(pattern.test(inputvalue)){         
		return true;   
    }else{   
		return false; 
    }
}


// validates and if everything is ok then sends
function validateAndSend() {
	if (validateForm()) {
		// disable button
		$("#send_button").addClass("disabled");	
		// unbind it from function
		$("#send_button").unbind();
		// change button msg
		$("#send_button").html($("#error_msgs #submit_working").attr("value"));
		// send form data
		var data = $('#form').serialize();
		$.post("/clerk.php", data, clerkResponse, "json");
		// fade out form and disable option edit
		$('.part:not(#send)').fadeTo('slow', 0.33);
		enable_options = false;

	} else { return false; }
}

function sendPlace() {
	if (validatePlace()) {
		// disable button
		$("#send_button").addClass("disabled");	
		// unbind it from function
		$("#send_button").unbind();
		// change button msg
		$("#send_button").html($("#error_msgs #submit_working").attr("value"));
		// send form data
		var data = $('#form').serialize();
		$.post("/add_place.php", data, addPlaceResponse, "json");	
	}	
	else { return false;}
}

// ajax response callbak
function addPlaceResponse(data) {
	// 1 means ok
	if (data.code == 1) {		
		writeNick();
		// change button msg to OK!
		$("#send_button").html($("#error_msgs #submit_done").attr("value"));
		$("#social").fadeIn('slow');
		$.scrollTo('#social', 5000);
	} else {
		// code !=1 means error
		// enable button again to allow retry
		$("#send_button").removeClass("disabled");	
		$("#send_button").html($("#error_msgs #submit_retry").attr("value"));
		//fadein form again
		$('.part:not(#send)').fadeTo('medium', 1);
		// rebind function
		$("#send_button").bind("click", sendPlace);		
	}
	// display response msg
	jAlert(data.msg, data.title);
}

// ajax response callbak
function clerkResponse(data) {
	// 1 means ok
	if (data.code == 1) {		
		// change button msg to OK!
		$("#send_button").html($("#error_msgs #submit_done").attr("value"));
		$("#social").fadeIn('slow');
		$.scrollTo('#social', 5000);
	} else {
		// code !=1 means error
		// enable button again to allow retry
		$("#send_button").removeClass("disabled");	
		$("#send_button").html($("#error_msgs #submit_retry").attr("value"));
		//fadein form again
		$('.part:not(#send)').fadeTo('medium', 1);
		// rebind function
		$("#send_button").bind("click", validateAndSend);		
	}
	// display response msg
	jAlert(data.msg, data.title);
}




var map = null; // google map
var marker = null; // user marker
var circle = null; // user marker zone
var radius = 0.15; // radius in miles for zone
var geocoder = null; // to convert from address to coords
var mapControl = null; // controls for map

// Call this function when the page has been loaded
function initialize() {
	if (document.getElementById("map_canvas") != null) {
		map = new google.maps.Map2(document.getElementById("map_canvas"));
		lat = $("#map_lat").attr("value");
		lng = $("#map_lng").attr("value");
		
		if ($('#navbar .selected').attr('href') == '/hotspots') {
			radius = 0.02;
		}
		
		if (lat != '0' && lng != '0') {
			map.setCenter(new GLatLng(lat, lng), 15);
			radius = 0.02;
			
		} else if ( google.loader.ClientLocation !== null ) {
			
			// try to geolocate client
			map.setCenter(new google.maps.LatLng(google.loader.ClientLocation.latitude, google.loader.ClientLocation.longitude), 15);
			
		} else {
			
			map.setCenter(new GLatLng(0, 0), 2);
			
		}
		
		geocoder = new GClientGeocoder();
		mapControl = new GMapTypeControl();
		map.addControl(mapControl);
		map.addControl(new GLargeMapControl());
		GEvent.addListener(map, "mouseout", function() {
			document.getElementById('map_lat').value = map.getCenter().lat();
			document.getElementById('map_lng').value = map.getCenter().lng();			
		});
		moveUserMarker(map.getCenter());
		marker.openInfoWindowHtml($("#place_desc").attr("value"));
	}
	
}

// moves user marker to the specified point
function moveUserMarker(point) {
	// remove old marker
	if (circle != null && marker !== null) {
		map.removeOverlay(circle);
		map.removeOverlay(marker);
	}
	// create distinctive marker and special options
	var greenIcon = new GIcon(G_DEFAULT_ICON);
	greenIcon.image = 'http://seeshy.com/img/marker.png';

	map.setCenter(point);
	var markerOpts = {
		bouncy : true,
		draggable : true,
		icon : greenIcon
	};
	marker = new GMarker(point, markerOpts);
	map.addOverlay(marker);

	// create and place zone
	circle = new CircleOverlay(point, radius, "#336699", 1, 1, '#336699', 0.25);
	map.addOverlay(circle);
	GEvent.addListener(marker, "dragend", function(point) {
		moveUserMarker(point);
		$('#map_lat').attr('value', map.getCenter().lat());
		$('#map_lng').attr('value', map.getCenter().lng());
		$('#place_id').attr('value', 0);
	});
	$('#map_lat').attr('value', map.getCenter().lat());
	$('#map_lng').attr('value', map.getCenter().lng());				

}

// moves the map center to the specified address (if recognized)
function goToAddress() {
	address = document.getElementById('search_text').value;
	$('#place_id').attr('value', 0);
	if (geocoder) {
		geocoder.getLatLng(address, function(point) {
			if (!point) {
				alert(address + " not found");
			} else {
				// center map
				map.setCenter(point, 16);
				// create zone overlay
				moveUserMarker(map.getCenter());
				// search for nearby places
			}
		});
	}
}

